import React, { Profiler } from 'react';
import { HomePageContainer } from './HomePageContainer';
import DirectoryMenu from '../../components/directory/DirectoryMenu';

const HomePage = () => {
	return (
		<HomePageContainer>
			<Profiler>
				<DirectoryMenu />.
			</Profiler>
		</HomePageContainer>
	);
};

export default HomePage;
